import React, { ReactElement } from 'react'
import { createLogicalNot } from 'typescript';

interface Props {
    login: (user: any) => void;
}

export default function distributionofgames({login}: Props): ReactElement {

    const user = {
        name: '',
        email: ''
        };

    return (
        <form>
            <label>
                Name:
                <input type="text" onChange={(e) => {user.name = e.target.value}} />
            </label>
            <label>
                Email:
                <input type="text" onChange={(e) => {user.email = e.target.value}} />
            </label>
        <button onClick={ () => {login(user)}}>Submit</button>
        </form>


    )
}
